import React from "react";
import useFetchItems from "../hooks/useFetchItems";

function ItemList() {
    const { items, loading } = useFetchItems();

    if (loading) return <p>Carregando...</p>;

    return (
        <div>
            {items.map((item) => (
                <div key={item.id}>
                    <h2>{item.nome}</h2>
                    <p>{item.descricao}</p>
                </div>
            ))}
        </div>
    );
}

export default ItemList;
